        <div><label>Street</label>
        <input type='text'></input></div>
        <div><label>Postal Code</label>
        <input type='number'></input></div>
        <div><label>City</label>
        <input type='text'></input></div>
        <div className={classes.actions}><button onClick={props.onCancel} className={classes.button}>Cancel</button>
        <button className={classes.button}>Confirm</button></div>
        
        
        
        
        
    </form>
};

export default Checkout;
